function App() {

  const Father = styled.div`
  display:flex;
  `;

  const Box = styled.div`
  background-color:${(props) => props.bgColor};
  width: 100px;
  height: 100px;
  `

  // const Circle = styled(Box)`
  // border-radius:50px;
  // `
  const Btn = styled.button`
  color:white;
  background-color:tomato;
  border:0;
  border-radius:15px;
  `

  // const Text = styled.span`
  // color: white;
  // `;

  return (
    <>
      <Father as='header'>
        <Btn>Log in</Btn>
        <Btn as='a' href='/'>
          Log in
        </Btn>
      </Father>
    </>
  );
}

export default App;
